css:
.atom-commander-resizer .atom-commander-resize-handle {
  position: absolute;
  left: 0;
  right: 0;
  top: -5px;
  height: 10px;
  cursor: row-resize;
  z-index: 3;
}
.platform-win32 .atom-commander-resizer .atom-commander-resize-handle {
  cursor: ns-resize;
}
.atom-commander-menu-bar {
  position: absolute;
  top: 0;
  left: 0;
  width: 100%;
  z-index: 5;
  text-align: center;
}
.atom-commander-menu-bar .content {
  background-color: #282c34;
}
.atom-commander {
  height: 100%;
}
.atom-commander .content {
  width: 100%;
  overflow: hidden;
}
.atom-commander .left {
  width: 50%;
  float: left;
}
.atom-commander .right {
  width: 50%;
  float: right;
}
.atom-commander .search-panel {
  width: 100%;
  height: 1.5em;
  position: absolute;
  bottom: 0;
  left: 0;
  color: #e2c08d;
  background-color: #1b1d23;
  opacity: 0.8;
  z-index: 5;
}
.atom-commander-list-view-resizer {
  position: relative;
  width: 100%;
  overflow: hidden;
  cursor: default;
  -webkit-user-select: none;
  min-height: 80px;
  height: 200px;
  z-index: 2;
}
.atom-commander-list-view-scroller {
  height: 100%;
  width: 100%;
  overflow: auto;
}
.atom-commander-list-view {
  min-height: -webkit-min-content;
  min-width: 100%;
  position: relative;
}
.atom-commander-list-view .list {
  position: static;
}
.atom-commander-list-view-table {
  width: 100%;
}
.atom-commander-list-view-table th {
  text-align: center;
  font-weight: bold;
}
.atom-commander-list-view-table td {
  padding-top: 2px;
  padding-bottom: 2px;
  padding-left: 5px;
  padding-right: 5px;
}
.atom-commander-list-view-table .directory {
  font-weight: bold;
}
.atom-commander-list-view-table .extension {
  text-align: right;
}
.atom-commander-list-view-table .highlighted-focused {
  color: #d7dae0;
  background-color: #3a3f4b;
}
.atom-commander-list-view-table .highlighted-unfocused {
  color: #d7dae0;
  background-color: #31363f;
}
.atom-commander-list-view-table .selected {
  color: #e2c08d;
}
.atom-commander-diff-view {
  width: 100%;
  height: 100%;
  background-color: #1b1d23;
}
.atom-commander-diff-view .left-pane,
.atom-commander-diff-view .right-pane {
  width: 50%;
  height: 100%;
}
.atom-commander-diff-view .left-pane {
  float: left;
  border-right-color: #181a1f;
  border-right-style: solid;
  border-right-width: 1px;
}
.atom-commander-diff-view .right-pane {
  float: right;
}
